CREATE OR REPLACE VIEW SYS_USER AS 
SELECT ID,IDCARD,MOBILE,EMAIL,PASSWORD,1 AS ROLE,NAME,ORGANIZATION,CREATEUSER,LEVEL,STATUS,CREATOR,CREATTIME FROM PROJECT_ADMIN 
UNION 
SELECT ID,IDCARD,MOBILE,EMAIL,PASSWORD,2 AS ROLE,NAME,ORGANIZATION,CREATEUSER,1 AS LEVEL,STATUS,CREATOR,CREATTIME FROM TRAINING_ADMIN 
UNION 
SELECT ID,IDCARD,MOBILE,EMAIL,PASSWORD,3 AS ROLE,NAME,ORGANIZATION,FALSE AS CREATEUSER,1 AS LEVEL,STATUS,CREATOR,CREATTIME FROM TEACHER 
UNION 
SELECT ID,IDCARD,MOBILE,EMAIL,PASSWORD,4 AS ROLE,NAME,0 AS ORGANIZATION,FALSE AS CREATEUSER,1 AS LEVEL,STATUS,CREATOR,CREATTIME FROM PROJECT_EXPERT
UNION
